import React from "react";
import ReactDOM from "react-dom";
import "./style/index.scss";
import App from "./components/App";
import Counter from "./components/Counter";
import ControlledInput from "./components/ControlledInput";
import ControlledForm from "./components/ControlledForm";
import CallbackAsProps from "./components/CallbackAsProps";
import LifeComponent from "./components/LifeComponent";
import ConditionalRender from "./components/ConditionalRender";
import TernaryRender from "./components/TernaryRender";
import ConditionalFromProps1 from "./components/ConditionalFromProps1";
import ConditionalFromProps2 from "./components/ConditionalFromProps2";
import { HashRouter } from "react-router-dom";

ReactDOM.render(
  <HashRouter>
    <App />
    <Counter />
    <ControlledInput />
    <ControlledForm />
    <CallbackAsProps />
    <LifeComponent />
    <ConditionalRender />
    <TernaryRender />
    <ConditionalFromProps1 />
    <ConditionalFromProps2 />
  </HashRouter>,
  document.getElementById("root")
);
